import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { FormsModule } from '@angular/forms';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MatSlideToggleModule } from '@angular/material/slide-toggle';
import { ProduitsContentComponent } from './components/produits-content/produits-content.component';
import { CommandesContentComponent } from './components/commandes-content/commandes-content.component';
import { PaiementsContentComponent } from './components/paiements-content/paiements-content.component';
@NgModule({
  declarations: [
    AppComponent,
    ProduitsContentComponent,
    CommandesContentComponent,
    PaiementsContentComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    BrowserAnimationsModule,
    MatSlideToggleModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
